//---------------------------------------------------
MRI_SURFACE *ic2562_make_two_icos(float x1, float y1, float z1, float r1, float x2, float y2, float z2, float r2)
//---------------------------------------------------
{
  MRI_SURFACE *mris;
  int vno, fno, n, vn, n1, n2;
  static int first_time = 1;

  //-----------------------------------------
  // [GW] For some reason the columns need to be
  // swapped around -- not sure why the table
  // couldn't just be edited?
  //-----------------------------------------

  if (first_time) {
    first_time = 0;
    for (fno = 0; fno < ICO_NFACES; fno++) {
      vno = gw_ic2562_faces[fno].vno[1];
      gw_ic2562_faces[fno].vno[1] = gw_ic2562_faces[fno].vno[2];
      gw_ic2562_faces[fno].vno[2] = vno;
    }
  }

  mris = MRISalloc(ICO_NVERTICES * 2, ICO_NFACES * 2);

  //----------------------------------
  // Positions for ico 1
  //----------------------------------
  for (vno = 0; vno < ICO_NVERTICES; vno++) {
    MRISsetXYZ(mris,vno,
      r1 * gw_ic2562_vertices[vno].x + x1,
      r1 * gw_ic2562_vertices[vno].y + y1,
      r1 * gw_ic2562_vertices[vno].z + z1);
  }

  //----------------------------------
  // Positions for ico 2
  //----------------------------------
  for (vno = 0; vno < ICO_NVERTICES; vno++) {
    MRISsetXYZ(mris, vno + ICO_NVERTICES,
      r2 * gw_ic2562_vertices[vno].x + x2,
      r2 * gw_ic2562_vertices[vno].y + y2,
      r2 * gw_ic2562_vertices[vno].z + z2);
  }

  //-------------------------------------
  // fill in faces, for ico 1
  // and count # of faces each vertex is part of
  //-------------------------------------
  for (fno = 0; fno < ICO_NFACES; fno++) {
    FACE* f = &mris->faces[fno];
    for (n = 0; n < VERTICES_PER_FACE; n++) {
      f->v[n] = gw_ic2562_faces[fno].vno[n] - 1; /* make it zero-based */
      VERTEX_TOPOLOGY* const vt = &mris->vertices_topology[f->v[n]];
      vt->num++;
      addVnum(mris,f->v[n],2);     /* will remove duplicates later */
    }
  }

  //-------------------------------------
  // fill in faces, for ico 2
  //-------------------------------------
  for (fno = 0; fno < ICO_NFACES; fno++) {
    FACE* const f = &mris->faces[fno + ICO_NFACES];
    for (n = 0; n < VERTICES_PER_FACE; n++) {
      f->v[n] = (gw_ic2562_faces[fno].vno[n] - 1) + ICO_NVERTICES; /* make it zero-based */
      VERTEX_TOPOLOGY* const vt = &mris->vertices_topology[f->v[n]];
      vt->num++;
      addVnum(mris,f->v[n],2); /* will remove duplicates later */
    }
  }

  //-------------------------------------
  // Space for vertex neighbor list
  //-------------------------------------

  for (vno = 0; vno < mris->nvertices; vno++) {
    VERTEX_TOPOLOGY* const vt = &mris->vertices_topology[vno];
    vt->v = (int *)calloc(vt->vnum / 2, sizeof(int));
    if (!vt->v) ErrorExit(ERROR_NOMEMORY, "%s: could not allocate %dth vertex list.", __func__, vno);
    clearVnum(mris,vno);
  }

  //-------------------------------------
  // now build list of neighbors
  //-------------------------------------
  for (fno = 0; fno < mris->nfaces; fno++) {
    FACE* const f = &mris->faces[fno];
    if (fno == 3) DiagBreak();
    for (n = 0; n < VERTICES_PER_FACE; n++) {
      VERTEX_TOPOLOGY* const vt = &mris->vertices_topology[f->v[n]];

      /* now add an edge to other 2 vertices if not already in list */
      for (n1 = 0; n1 < VERTICES_PER_FACE; n1++) {
        if (n1 == n) /* don't connect vertex to itself */
          continue;

        //------------------------------------------------------
        // [GW] In the following, not sure why we need to use
        // table rather than mris, but that's how existing code
        // does it.
        //------------------------------------------------------
        if (fno < ICO_NFACES) {
          vn = gw_ic2562_faces[fno].vno[n1] - 1; /* make it zero-based */
        }
        else {
          vn = gw_ic2562_faces[fno - ICO_NFACES].vno[n1] - 1 + ICO_NVERTICES; /* make it zero-based */
        }

        /* now check to make sure it's not a duplicate */
        for (n2 = 0; n2 < vt->vnum; n2++) {
          if (vt->v[n2] == vn) {
            vn = -1; /* mark it as a duplicate */
            break;
          }
        }
        if (vn >= 0) vt->v[vnumAdd(mris,f->v[n],1)] = vn;
      }
      
      vt->nsizeMax = vt->nsizeCur = 1;
    }
  }

  //----------------------------------------
  // now allocate face arrays in vertices /
  //----------------------------------------
  for (vno = 0; vno < mris->nvertices; vno++) {
    VERTEX_TOPOLOGY* const vt = &mris->vertices_topology[vno];
    vt->vtotal = vt->vnum;
    vt->f = (int *)calloc(vt->num, sizeof(int));
    if (!vt->f) ErrorExit(ERROR_NO_MEMORY, "ic2562: could not allocate %d faces", vt->num);
    vt->n = (unsigned char *)calloc(vt->num, sizeof(unsigned char));
    if (!vt->n) ErrorExit(ERROR_NO_MEMORY, "ic2562: could not allocate %d nbrs", vt->n);
    vt->num = 0; /* for use as counter in next section */
  }

  //----------------------------------------------
  // fill in face indices in vertex structures /
  //----------------------------------------------
  for (fno = 0; fno < mris->nfaces; fno++) {
    FACE* f = &mris->faces[fno];
    for (n = 0; n < VERTICES_PER_FACE; n++) {
      VERTEX_TOPOLOGY* const vt = &mris->vertices_topology[f->v[n]];
      vt->n[vt->num] = n;
      vt->f[vt->num++] = fno;
    }
  }

  mrisCheckVertexFaceTopology(mris);

  MRIScomputeMetricProperties(mris);

  mris->type = MRIS_ICO_SURFACE;
  return (mris);
}
